#include "Gfx.h"
#include "CharCodeToUnicode.h"
#include "Splash.h" // Include Splash.h to resolve the issue with SplashColorMode

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    FuzzedDataProvider stream(data, size);

    // Initialize parameters for drawChar function
    GfxState *gfxState = reinterpret_cast<GfxState*>(0x12345678); // Dummy pointer value
    double x = stream.ConsumeFloatingPoint<double>();
    double y = stream.ConsumeFloatingPoint<double>();
    double dx = stream.ConsumeFloatingPoint<double>();
    double dy = stream.ConsumeFloatingPoint<double>();
    double ox = stream.ConsumeFloatingPoint<double>();
    double oy = stream.ConsumeFloatingPoint<double>();
    CharCode code = stream.ConsumeIntegral<CharCode>();
    int nBytes = stream.ConsumeIntegral<int>();
    Unicode *u = nullptr; // Initialize to nullptr
    int uLen = 0;
    GBool rotate = stream.ConsumeBool();
    GBool scale = stream.ConsumeBool();
    GBool showText = stream.ConsumeBool();

    // Call the function-under-test
    SplashOutputDev splashOutputDev(SplashColorMode::scRGB8, 0, gFalse, nullptr); // Provide necessary arguments to the constructor
    splashOutputDev.drawChar(gfxState, x, y, dx, dy, ox, oy, code, nBytes, u, uLen, rotate, scale, showText);

    return 0;
}

